webpackJsonp([0xddd3b06eaa1a],{2839:function(e,a){e.exports={data:{markdownRemark:{html:'<p>It is a doujinshi circle that makes the original work of <a href="http://www16.big.or.jp/%7Ezun/html/game.html">Touhou Project</a> secondary, and so on, occasionally, and it is also a website. The atmosphere of the site may not seem to be eastward, but do not worry. Recently just a little bit fascinated with VOCALOID.</p>\n<p>The origin of the name is a respect for " <a href="http://www.ongaq.com/taq/">ongaq</a> ". In the German-speaking world, "ku" is written as "q". Especially the danmaq has no meaning in spelling itself. It may be meaningful in Turkish languages.</p>\n<h2>Circle members</h2>\n<p>Circle representative <a href="?t=Manager">Mc (Maku)</a> . The permanent member is a solo circle of only one representative. (In principle, as recruiting club members temporarily for each project and taking the form to dissolve after project completion)</p>',frontmatter:{cover:null,date:"2004-12-28T00:00:59+09:00",strDate:"2004/12/27",title:"What is danmaq?"}}},pathContext:{path:"/en/blog/2004/12/28-danmaqとは/",langKey:"en"}}}});
